	public static double calc(byte c1, String op, byte c2) {
		if (op.charAt(0) == '+') {
			double result = c1 + c2;
			return result;
		} else if (op.charAt(0) == '-') {
			double result = c1 - c2;
			return result;
		} else if (op.charAt(0) == '*' || op.charAt(0) == 'x') {
			double result = c1 * c2;
			return result;
		} else if (op.charAt(0) == '/' || op.charAt(0) == 'ÅÄ') {
			double result = c1 / c2;
			return result;
		} else if (op.charAt(0) == '%') {
			double result = c1 % c2;
			return result;
		} else {
			return 0.0d;
		}
		
		
	}
	
